=Given the option contract details below, make a buy or don't buy recommendation based on short-term flipping potential — not based on whether the option expires in the money.

The trader is looking to profit from a quick premium increase, not to exercise the contract. Trades are typically exited within minutes, hours, or up to 1–2 days.

The current time is {{ $json["currentTimeET"] }} (Eastern), with {{ $json["minutesUntilClose"] }} minutes left until the market closes. Assume the trader may enter the position immediately.

Focus your analysis on momentum, liquidity, and short-term risk/reward — not on expiration value or long-term outcomes.

Option details:

- Ticker: {{ $json["ticker"] }}
- Type: {{ $json["type"] }}
- Strike: {{ $json["strike"] }}
- Expiration: {{ $json["expiration"] }}
- Days to Expiration: {{ $json["daysToExpiration"] }}
- Base Price: {{ $json["baseLastPrice"] }}
- Volume: {{ $json["volume"] }}
- Open Interest: {{ $json["openInterest"] }}
- Volatility: {{ $json["volatility"] }}
- Delta: {{ $json["delta"] }}
- Volume/Open Interest Ratio: {{ $json["volumeOpenInterestRatio"] }}
- Current Bid: {{ $json.bid }}
- Current Ask: {{ $json.ask }}
- Midpoint: {{ $json.mid }}
- Last Traded Price: {{ $json.last }}

The current time is {{ $json["currentTimeET"] }} (Eastern), with {{ $json["minutesUntilClose"] }} minutes left until the market closes.

Respond in JSON format:
{
  "shouldBuy": boolean,
  "confidence": float,
  "idealEntryPrice": float,
  "opinion": "short reason why this is or isn’t a good trade"
}

