const ruleProb = parseFloat($('Loop Over Items').first().json.probabilityOfProfit);
const llmConfidence = parseFloat($json.output.confidence);
return {
  json: {
    ...$('Loop Over Items').first().json,
    finalConfidence: Math.round((ruleProb * 0.6 + llmConfidence * 0.4) * 100) / 100,
    llmOpinion: $json.output.opinion,
    llmConfidence,
    llmShouldBuy: $json.output.shouldBuy,
    llmIdealEntryPrice: $json.output.idealEntryPrice
  }
}

const nowET = DateTime.now().setZone("America/New_York");
const marketClose = nowET.set({ hour: 16, minute: 0, second: 0, millisecond: 0 });

const minutesUntilClose = Math.max(0, Math.round(marketClose.diff(nowET, "minutes").minutes));
const currentTimeET = nowET.toISO();

const items = $input.all().map(item => {
  item.json.currentTimeET = currentTimeET;
  item.json.minutesUntilClose = minutesUntilClose;
  return item;
});

return items;

const staticData = $getWorkflowStaticData('global');
const seenTrades = staticData?.tweetedOptionSymbols || [];

const trades = $json.data.filter(t => !seenTrades.includes(t.symbol));
staticData.tweetedOptionSymbols = Array.from(new Set([...seenTrades, ...trades.map(t => t.symbol)]));

const tweets = [];

for (const t of trades) {
  if (!t.minutesUntilClose || t.minutesUntilClose === 0) continue;

  const tweet = 
`$${t.ticker} ${t.type} $${t.strike} exp ${t.expiration}

📍 Entry: $${t.idealEntryPrice} | Bid: $${t.bid} | Ask: $${t.ask} | Δ: ${t.delta}
✅ Should Buy: Human - ${t.shouldBuy ? "Yes" : "No"}, AI - ${t.llmShouldBuy ? "Yes" : "No"}
📊 Confidence: Human - ${t.finalConfidence ?? "N/A"}, AI - ${t.llmConfidence ?? "N/A"}

🧠 Human Opinion:
${t.opinion}

🤖 AI Opinion:
${t.llmOpinion}`;

  tweets.push({ json: { tweet } });
}

// If no valid tweets were generated, return fallback
if (tweets.length === 0) {
  return [{ json: { tweet: "✅ No new trades to report." } }];
}

return tweets;

const staticData = $getWorkflowStaticData('global');
const seenTrades = staticData?.seenOptionSymbols || [];
const trades = $json.data.filter(t => !seenTrades.includes(t.symbol));
staticData.seenOptionSymbols = [...new Set([...seenTrades, ...trades.map(t => t.symbol)])];

if (trades.length === 0) {
  return [{ json: { discordMessage: "✅ No new trades to report." } }];
}

const fullChunks = [];
let currentChunk = "🔥 Top Bandwagon Trades\n\n";

for (let i = 0; i < trades.length; i++) {
  const t = trades[i];

  const tradeText = `${i + 1}. **${t.ticker}** - ${t.type} $${t.strike} exp ${t.expiration}

📊 Vol/OI: ${t.volumeOpenInterestRatio}  
🎯 Rule Score: ${t.probabilityOfProfit}  
🤖 AI Score: ${t.llmConfidence}  
📈 Final Score: ${t.finalConfidence}

💸 Ideal Entry Price:  
🤖 AI: $${t.llmIdealEntryPrice}  
🧠 Human: $${t.idealEntryPrice}

❓ Should you buy:  
🤖 AI: ${t.llmShouldBuy ? "Yes" : "No"}  
🧠 Human: ${t.shouldBuy ? "Yes" : "No"}

🤖 *AI Opinion:*  
${t.llmOpinion}

🧠 *Human Opinion:*  
${t.opinion}

`;

  if ((currentChunk + tradeText).length > 4000) {
    fullChunks.push({ json: { discordMessage: currentChunk.trim() } });
    currentChunk = tradeText;
  } else {
    currentChunk += tradeText;
  }
}

if (currentChunk.trim() !== "") {
  fullChunks.push({ json: { discordMessage: currentChunk.trim() } });
}

return fullChunks;
